INSERT INTO `aboutus` (`id`, `crdate`, `ip`, `pagename`, `heading`, `content`, `image`, `status`) VALUES
(1, '2019-12-03 08:11:13', '157.49.193.208', 'The BNTX token', 'The BNTX token', '\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n ', '1569053544image620568333.jpg', '1'),
(2, '2020-03-21 01:06:17', '157.44.155.19', 'About The Bintex', 'About The Bintex', '<p class=\"p1\" style=\"margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 12px; line-height: normal; font-family: \"Helvetica Neue\"; color: rgb(0, 0, 0);\">The BintexFutures token is the base currency of the Bintex Futures Exchange and all traders on the exchange must own BNTX to participate in our commission, non-custodial markets. Demand for BNTX from traders is an integral part of the revenue model that allows the exchange to operate sustainably with<span class=\"Apple-converted-space\">  </span>transaction fees on all trades.<span class=\"Apple-converted-space\">  </span>charging transaction fees on trades, the exchange covers costs by minting a small number of new BNTX tokens each year and selling them in well publicized and transparent token sales.</p>', '1566153933image1982103666.jpg', '1'),
(3, '2019-12-03 08:51:09', '27.6.3.249', 'Download Whitepaper', 'Download Whitepaper', '<h1 style=\"color: white;\">Will Update Soon</h1>\r\n<!--<p>A white paper is an authoritative report or guide that informs readers concisely about a complex issue and presents the issuing body\'s philosophy on the matter. It is meant to help readers understand an issue, solve a problem, or make a decision.</p>\r\n<p>Marketers create whitepapers to educate their audience about a particular issue, or explain and promote a particular methodology.</p> -->        ', '1566272334image1611764104.jpg', '1'),
(4, '2019-11-30 12:03:35', '157.49.163.168', 'Token Sale Proceeds', 'Token sales are, quite simply, a process of generating and selling a new cryptocurrency. In this process you are selling cryptographically generated tokens..', '<li><p>Marketing & General.</p></li>\r\n<li><p>Team & Advisors.</p></li>\r\n<li><p>Pre-ICO Tokens.</p></li>\r\n<li><p>Platform Integration.</p></li>\r\n<li><p>Mobile Ad Platform.</p></li>        ', '1566552420image1184101576.jpg', '1'),
(5, '2020-03-21 01:01:47', '157.44.184.182', 'Token Distribution\r\n', 'It is also possible to have a static supply with a dynamic funding goal, in which the distribution of tokens will be made according to the funds received.', '', '1566552666image319560203.jpg', '1'),
(6, '2019-09-21 08:51:56', '27.6.0.202', 'Download Mobile App\r\n', 'Download Mobile App', 'Coming Soon<div></div>  ', '1566553523image1840265305.jpg', '1'),
(7, '2019-08-05 14:45:44', '49.206.201.173', 'Visa', 'Visa', 'Keeping in view of increased security measures, we would like to request all the participants to apply for Visa as soon as possible. Scietech International conferences will not directly contact embassies and consulates on behalf of visa applicants. Important note for failed visa applications: Visa issues cannot come under the consideration of cancellation policy of Scietech International conferences, including the inability to obtain a visa. ', '', '1'),
(8, '2019-07-31 07:02:15', '49.206.200.188', '', 'Content', '<span style=\"font-weight: bold;\">Cancellation Postponement Policy</span><div>If Scietech International cancels or postpone this event for any reason, and you are unable/unwilling to attend our other conference or for rescheduled dates you will receive a credit for 100% of the registration fee paid. You may use this credit for another Scietech international conferences event which must occur within one year from the date of cancellation.</div><div><br></div><div><span style=\"font-weight: bold;\">Transfer Of Registration</span></div><div>All fully paid registrations are transferable to other persons from the same organization, if registered person is unable to attend the event. \r\nRegistration can be transferred to one conference to another conference of Scietech International conferences if the person is unable to attend one of conferences. \r\nThe transferred registrations will not be eligible for Refund.</div><div><br></div><div><span style=\"font-weight: bold;\">Visa Information</span></div><div>Keeping in view of increased security measures, we would like to request all the participants to apply for Visa as soon as possible. Scietech International conferences will not directly contact embassies and consulates on behalf of visa applicants. \r\nImportant note for failed visa applications: Visa issues cannot come under the consideration of cancellation policy of Scietech International conferences, including the inability to obtain a visa.</div><div><br></div><div><span style=\"font-weight: bold;\">Refund Policy</span></div><div>If the registrant is unable to attend, and is not in a position to transfer his/her participation to another person or event, then the following refund arrangements apply:</div><div>1.	Before 90 days of the conference: Eligible for 70% of payment Refund</div><div>2.	Within 60-45 days of Conference: Eligible for 50% of payment Refund</div><div>3.	Within 45 days of Conference: Not eligible for Refund</div><div>4.	Video presentations &E-Poster Payments will not be refunded.</div><div><span style=\"font-weight: bold;\"><br></span></div><div><span style=\"font-weight: bold;\">Accommodation Cancellation Policy</span></div><div>Accommodations charges are non-refundable, because of prior mock bookings from the hotel</div>      ', '', '1');
