INSERT INTO `content` (`id`, `crdate`, `menu`, `submenu`, `suubmenu`, `heading`, `subheading`, `benefits`, `features`, `downloads1`, `downloads2`, `downloads3`, `downloads4`, `table`, `img1`, `img2`, `img3`, `status`) VALUES
(1, '2019-01-16 20:21:33', 1, 1, 1, 'CP0611-D28H', 'The Super Industrial in Renewed Design', '<ul>\r\n<li>Powerful</li>\r\n<li>Fast rundown</li>\r\n<li>High Durability</li>\r\n<li>Compact</li>\r\n<li>Lightweight</li>\r\n<li>Versatile</li>\r\n<li>Comfort</li>\r\n</ul>', '<ul>\r\n<li>70 ft.lbs. / 95 Nm</li>\r\n<li>225 RPM</li>\r\n<li>Advanced motor, full caged gear, and head design</li>\r\n<li>Only 10.7in / 272mm long</li>\r\n<li>Better access to restricted areas</li>\r\n<li>2.7 lbs. / 1.2 kg</li>\r\n<li>Adjustable side exhaust avoids blowing dirt and dust</li>\r\n<li>Ergonomic composite grip insulates operator’s hand from cold</li>\r\n<li>Designed for a variety of applications from heavy ones such as transmission, suspension, work till light ones engine repair, dashboard work and general maintenance</li>\r\n<li>Made in Japan</li>\r\n</ul>', '1', '1', '1', '1', '<table class=\"c-table s-editor s-editor--table tablesaw tablesaw-swipe\"  style=\"\"><thead><tr><th scope=\"col\" data-tablesaw-priority=\"persist\" class=\" tablesaw-swipe-cellpersist\"></th><th scope=\"col\" class=\"\">Metric</th><th scope=\"col\" class=\"\">Imperial</th></tr></thead><tbody><tr><td class=\" tablesaw-swipe-cellpersist\">Model</td><td class=\"\">CP7829</td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Part number</td><td class=\"\">8941078293</td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Actual air consumption</td><td class=\"\">312 l/mn</td><td class=\"\">10.95 cfm</td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Air inlet thread size</td><td class=\"\">1/4 \"</td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">European Sound standard</td><td class=\"\">EN ISO 15744 </td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Free speed</td><td class=\"\">225 rpm</td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Free speed air consumption</td><td class=\"\">11.3 l/s</td><td class=\"\">23.88 cfm</td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Length</td><td class=\"\">272 mm</td><td class=\"\">10.7 \"</td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Max torque</td><td class=\"\">95 Nm</td><td class=\"\">70 ft.lbs</td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Min. hose size</td><td class=\"\">10 mm</td><td class=\"\">3/8 \"</td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Net weight</td><td class=\"\">1.235 kg</td><td class=\"\">2.72 lb</td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Sound Power</td><td class=\"\">96 db(A)</td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Sound pressure</td><td class=\"\">85 db(A)</td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Square drive</td><td class=\"\">3/8 \"</td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Vibration</td><td class=\"\">8.6 m/s²</td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Vibration ISO</td><td class=\"\">ISO-28927-2 </td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Vibration uncertainty (K)</td><td class=\"\">2 1/2 m/s²</td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Working torque Range</td><td class=\"\">15 - 68 Nm</td><td class=\"\">10 - 55 ft.lbs</td></tr></tbody>\r\n\r\n					</table>', 'img1.jpeg', 'img2.jpeg', 'img3.jpeg', '1'),
(2, '2019-01-16 20:21:49', 1, 1, 1, 'CP0611-D28H + FRL KIT ', 'The Super Industrial in Renewed Design with FRL Kit', '<ul>\r\n<li>Best 1\" impact to loosen big bolts on very demanding industries</li>\r\n<li>FRL kit for longer life and higher quality of work</li>\r\n<li>Operator comfort and control thanks to perfect ergonomic design even at VERY high torque</li>\r\n<li>Progressive torque thanks to the 2-Jaw clutch</li>\r\n<li>Unmatched durability with reliable mechanism & durable housing</li>\r\n<li>Ideal for Heavy Industrial Maintenance and Production applications</li>\r\n</ul>', '<ul class=\"myul\">\r\n<li>Super Industrial 1\" impact wrench</li>\r\n<li>FRL in a robust stand</li>\r\n<li>Reliable 2-jaw clutch with the highest Blows per Minutes</li>\r\n<li>Full Teasing (inside) trigger with durable reverse</li>\r\n<li>Durable aluminum body & indestructible steel clutch housing</li>\r\n<li>Compact 3-part construction & easy maintenance</li>\r\n<li>Hole type socket retainer with O-ring</li>\r\n<li>360° adjustable D-type side handle</li>\r\n</ul>', '1', '2', '3', '4', '<table data-tablesaw-mode=\"swipe\" data-tablesaw-minimap=\"\" class=\"c-table s-editor s-editor--table tablesaw tablesaw-swipe\" id=\"tablesaw-7606\" style=\"\"><thead><tr><th scope=\"col\" data-tablesaw-priority=\"persist\" class=\" tablesaw-swipe-cellpersist\"></th><th scope=\"col\" class=\"\">Metric</th><th scope=\"col\" class=\"\">Imperial</th></tr></thead><tbody><tr><td class=\" tablesaw-swipe-cellpersist\">Model</td><td class=\"\">CP0611-D28H + FRL KIT</td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Part number</td><td class=\"\">6153991550</td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Actual air consumption</td><td class=\"\">32 l/s</td><td class=\"\">68 cfm</td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Air inlet thread size</td><td class=\"\">1/2 \"</td><td class=\"\"></td></tr><tr><td class=\" tablesaw-swipe-cellpersist\">Blows per 