(38, '2019-08-18 19:21:18', '::1', 'Legal', '', '', 'Bitcoin legal?', 'To the best of our knowledge, Bitcoin has not been made illegal by legislation in most jurisdictions. However, some jurisdictions (such as Argentina and Russia) severely restrict or ban foreign currencies. Other jurisdictions (such as Thailand) may limit the licensing of certain entities such as Bitcoin exchanges.', '', '', '', '1'),
(39, '2019-12-30 05:00:25', '157.45.254.1', 'General', '', '', 'What is Bintexfutures?', ' Bintex Futures is a world-class blockchain company comprised of BintexPAY and various other cryptocurrency-related functions. & currently \r\nwe are developing a cryptocurrency futures exchange\r\n', '', '', '', '1'),
(40, '2020-01-04 15:21:30', '157.49.191.1', 'General', '', '', 'what is Blockchain?', ' A blockchain, originally block chain, is a growing list of records, called blocks, that are linked using cryptography. Each block contains a cryptographic hash of the previous block, a timestamp, and transaction data. By design, a blockchain is resistant to modification of the data.', '', '', '', '1'),
(41, '2020-01-04 15:24:43', '157.49.191.1', 'General', '', '', 'What is peer to peer Blockchain?', ' A Peer to Peer (abbreviated to P2P) network is a very important part of how blockchain technology works, and why it is so solid and secure. ... Despite all nodes being equal, they can take on different roles within the blockchain ecosystem, such as that of a miner or a “full node”', '', '', '', '1'),
(42, '2020-01-04 15:25:55', '157.49.191.1', 'General', '', '', 'How many types of Blockchain are there?', ' There mainly three types of Blockchains that have emerged after Bitcoin introduced Blockchain to the world. There are some more complicated types also such as public-permissioned blockchain, private-permissioned blockchain etc.', '', '', '', '1'),
(43, '2020-01-04 15:27:03', '157.49.191.1', 'General', '', '', 'what is Bitcoin?', ' Bitcoin is a cryptocurrency. It is a decentralized digital currency without a central bank or single administrator that can be sent from user to user on the peer-to-peer bitcoin network without the need for intermediaries', '', '', '', '1'),
(44, '2020-01-04 15:29:37', '157.49.191.1', 'General', '', '', 'What is BintexFutures Exchange?', ' The Bintex Futures Exchange is a revolutionary new futures exchange that will offer traders , real-time trading combined with non-custodial account balances.\r\n\r\nThe exchange is a hybrid that combines the speed and reliability of a centralized order matching engine with the security of decentralized account balances. For the first time, traders will enjoy real-time futures trading with instant, on-chain settlement, without the long delays, costs and other drawbacks of truly decentralized exchanges.', '', '', '', '1');
