(38, '2019-07-25 10:52:49', '183.82.117.28', 'Advanced Research in Microbiology and Public Health', '<h3><span style=\"font-size: 11pt; line-height: 107%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">This track deals with\r\nthe interdisciplinary researches & developments in microbiology and </span><a href=\"https://www.scietechinternational.com/microbiology/abstractsubmission\"><span style=\"font-size:11.0pt;line-height:107%;font-family:\" times=\"\" new=\"\" roman\",\"serif\";=\"\" mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">public health</span></a><span style=\"font-size: 11pt; line-height: 107%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">. Generally, </span><a href=\"https://www.scietechinternational.com/microbiology/abstractsubmission\"><span style=\"font-size:11.0pt;line-height:107%;font-family:\" times=\"\" new=\"\" roman\",\"serif\";=\"\" mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">Microbes</span></a><span style=\"font-size: 11pt; line-height: 107%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"> play an important\r\nrole in balancing the health in the society. This session covers the wide area of\r\nadvanced researches under Microbiology, Epidemiology, Public Health, Clinical\r\nMicrobiology, Diagnostic Microbiology, </span><a href=\"https://www.scietechinternational.com/microbiology/abstractsubmission\"><span style=\"font-size:11.0pt;line-height:107%;font-family:\" times=\"\" new=\"\" roman\",\"serif\";=\"\" mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">Environmental Microbiology</span></a><span style=\"font-size: 11pt; line-height: 107%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">, Astro Microbiology,\r\nAgriculture Microbiology, Food Microbiology, Molecular Microbiology, Industrial\r\nMicrobiology, Micro biome, Infectious Diseases and their preventive Measures, </span><a href=\"https://www.scietechinternational.com/microbiology/\"><span style=\"font-size:1