"\" roman\",\"serif\";=\"\" mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">European Society of Clinical Microbiology</span></a><span style=\"font-size: 11pt; line-height: 107%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"> and Infectious\r\nDiseases, Federation of European Microbiological Societies (FEMS).<o:p></o:p></span></h3><h3><span style=\"font-size: 11pt; line-height: 107%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\"><o:p> </o:p></span></h3><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><h3><span style=\"font-size: 11pt; line-height: 107%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">Asia-Pacific:  </span><a href=\"https://www.scietechinternational.com/microbiology/abstractsubmission\"><span style=\"font-size:11.0pt;line-height:107%;font-family:\" times=\"\" new=\"\" roman\",\"serif\";=\"\" mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">International Society for Applied\r\nPhycology</span></a><span style=\"font-size: 11pt; line-height: 107%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">;\r\nInternational Union of Microbiological Societies; Microscopy Society\r\n(Singapore), </span><a href=\"https://www.scietechinternational.com/microbiology/abstractsubmission\"><span style=\"font-size:11.0pt;line-height:107%;font-family:\" times=\"\" new=\"\" roman\",\"serif\";=\"\" mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">Singapore National Academy of\r\nSciences</span></a><span style=\"font-size: 11pt; line-height: 107%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">;\r\nJapanese Society of Microbial Ecology, Asia Pacific Society for Marine\r\nBiotechnology; Committee of Asia Pacific Electron Microscopy Societies; </span><a href=\"https://www.scietechinternational.com/microbiology/abstractsubmission\"><span style=\"font-size:11.0pt;line-height:107%;font-family:\" times=\"\" new=\"\" roman\",\"serif\";=\"\" mso-fa